sympy.sympy.core._print_helpers.__str__:
def __str__(self):
    from sympy.printing.str import sstr
    return sstr(self, order=None)

sympy.sympy.external.pythonmpq.__eq__:
def __eq__(self, other):
    """Compare equal with PythonMPQ, int, float, Decimal or Fraction"""
    if isinstance(other, PythonMPQ):
        return (self.numerator == other.numerator
            and self.denominator == other.denominator)
    elif isinstance(other, self._compatible_types):
        return self.__eq__(PythonMPQ(other))
    else:
        return NotImplemented

sympy.sympy.polys.rings.iterterms:
def iterterms(self) -> Iterator[tuple[Mon, Er]]:
    """Iterator over terms of a polynomial."""
    return iter(self.items())

sympy.sympy.polys.rings.is_element:
def is_element(self, element) -> TypeIs[PolyElement[Er]]:
    """Check if element belongs to this ring."""
    return isinstance(element, PolyElement) and element.ring == self
